import { useEffect } from 'react';
import { useState } from 'react';

function Livedate(){
    const [now,setNow]=useState(1)
    function updateNow() {
        setNow(prevNow=>prevNow+1)
    }
    useEffect(()=>{
        setInterval (()=>{updateNow()},1000)
      },[])

    return (
    <p>ciao:{now}</p>
        )
}

export default Livedate
